(1,11,'en','The May Fair Hotel','<p>Built in 1986, Hotel Stanford is a distinct addition to New York (NY) and a smart choice for travelers. The excitement of the city center is only 0 KM away. No less exceptional is the hotel’s easy access to the city’s myriad attractions and landmarks, such as Toto Music Studio, British Virgin Islands Tourist Board, L’Atelier Du Chocolat. Start and end in San Francisco! With the in-depth cultural tour Northern California Summer 2019, you have a 8 day tour package taking you through San Francisco, USA and 9 other destinations in USA. Northern California Summer 2019 includes accommodation as well as an expert guide, meals, transport and more.</p>\n<h4>HIGHLIGHTS</h4>\n<ul>\n<li>Visit the Museum of Modern Art in Manhattan</li>\n<li>See amazing works of contemporary art, including Vincent van Gogh\'s The Starry Night</li>\n<li>Check out Campbell\'s Soup Cans by Warhol and The Dance (I) by Matisse</li>\n<li>Behold masterpieces by Gauguin, Dali, Picasso, and Pollock</li>\n<li>Enjoy free audio guides available in English, French, German, Italian, Spanish, Portuguese</li>\n</ul>','Paris Cinemas Battery','[{\"title\":\"Guarantee Policy\",\"content\":\"- A valid credit card will be required upon booking;\\r\\n- For credit card reservations, the same card(s) must be presented upon check in at the respective hotels;\\r\\n- Management reserves the right to cancel any reservations without notice if we are notified of any fraud or illegal activities associated with the full payments received.\"},{\"title\":\"Children Policy\",\"content\":\"- Child under 5-year old: free of charge.\\r\\n- Child from 5-year old to under 12-year old: surcharge $10\\/person\\/room\\/night.\\r\\n- Child from 12-year old or extra Adult: surcharge $15\\/person\\/room\\/night.\"},{\"title\":\"Cancellation\\/Amendment Policy\",\"content\":\"- If cancellation\\/amendment is made 72 hours prior to your arrival date, no fee will be charged.\\r\\n- If cancellation\\/amendment